import React from "react";
import Item from "./Item";
import dashboardIcon from "../../icons/dashboard.png";  // Путь к иконке
import ContolPanelIcon from "../../icons/control_panel.png";
import PnlIcon from "../../icons/pnl.png";
import HistoryIcon from "../../icons/history.png";
import SecurityIcon from "../../icons/security_gray.png";


const MainMenu = () => {
  return (  
    
    <div>
      <Item
        text="Dashboard"
        icon={dashboardIcon}  // Передаем импортированную иконку
        onClick={() => alert("Dashboard clicked!")}
        className="dashboard-button"  // Уникальный класс для кнопки Dashboard
      />
      <Item
        text="Control Panel"
        icon={ContolPanelIcon}  // Передаем импортированную иконку
        onClick={() => alert("Control Panel clicked!")}
        className="control-panel-button"  // Уникальный класс для кнопки Control Panel
      />
      <Item
        text="PNL"
        icon={PnlIcon}  // Передаем импортированную иконку
        onClick={() => alert("PNL clicked!")}
        className="pnl-button"  // Уникальный класс для кнопки PNL
      />
      <Item
        text="History"
        icon={HistoryIcon}  // Передаем импортированную иконку
        onClick={() => alert("History clicked!")}
        className="history-button"  // Уникальный класс для кнопки History
      />
      <Item
        text="Security"
        icon={SecurityIcon}  // Передаем импортированную иконку
        onClick={() => alert("Security clicked!")}
        className="security-button"  // Уникальный класс для кнопки Security
      />
    </div>
  );
};

export default MainMenu;
